INSERT INTO `proyectos` (`ID_PROYECTO`, `ID_AREA`, `PROYECTO_NOMBRE`, `URL`, `PROYECTO_DESCRIPCION`, `IMAGEN`, `IMAGEN_FONDO`, `DURACION`, `FECHA_INICIO`, `FECHA_FINAL`, `FECHA_ENTREGA`, `ENLACE_ENTREGABLE`, `ENLACE_EDITABLE`, `COLOR`, `TIPO`, `PRIORIDAD`, `ESTADO`, `ORDEN`, `VALIDACION`, `ID_LISTA`) VALUES (56, 1, '01S.01_Pruebas_Lista_de_cotejo_2023', '01s01_pruebas_lista_de_cotejo_2023', '<p><span style=\"font-size: 14px;\">¡Hola!</span></p><p><span style=\"font-size: 14px;\">Comparto con ustedes el proyecto para que puedan hacer sus asignaciones de tareas con listas de cotejo, pueden hacer el ejercicio de asignar a cualquiera que se encuentre en este proyecto para que puedan visualizar como se generan los procesos.</span></p><p><span style=\"font-size: 14px;\">En la siguiente liga podrán tener acceso a las </span><a href=\"https://drive.google.com/drive/folders/1I5xBgapqHRO4Re73O1MbBtlrnIeQ7tQN\" target=\"_blank\"><u>listas de cotejo y a el registro de incidencias</u></a><span style=\"font-size: 14px;\">&nbsp;considerar lo siguiente para el llenado de incidencias:</span></p><ul><li><span style=\"text-align: var(--bs-body-text-align);\"><b>08C.20_POLARIS_INCIDENCIAS_2023</b>. Incidencias en general, sobre la navegación o errores en las secciones de Polaris.</span></li><li><span style=\"text-align: var(--bs-body-text-align);\"><b>08C.20_Lista_Cotejo_Incidencias_2023</b>: Incidencias que atañen sólo a la creación, modificación o asignación de listas de cotejo.&nbsp;</span></li></ul><p>Si tienen alguna duda, Andrés y yo estaremos atentos para ayudarlos.</p><p>Equipos de pruebas.</p><p><google-sheets-html-origin style=\"font-size: medium;\"></google-sheets-html-origin></p><table xmlns=\"http://www.w3.org/1999/xhtml\" cellspacing=\"0\" cellpadding=\"0\" dir=\"ltr\" border=\"1\" style=\"table-layout: fixed; font-size: 12pt; font-family: Calibri; width: 0px; border-collapse: collapse; border: none;\"><colgroup><col width=\"122\"><col width=\"141\"><col width=\"139\"><co